(2,2,1,'English','1',NULL,'Indore City',NULL,'welcome to indore',NULL,'aditi devo bhava',NULL,'Delhi Walks is a passionate endeavour to make the bygone eras come alive through various remnants of the past scattered across the city. Our walks are tailored to suit your interests for a perfect introduction to the eternal City of Cities. Our experienced and knowledgeable Walk Leaders® are driven to showcase the heart of Delhi. Experience the unique itineraries which assure fascinating and fun-filled memories. So, don’t miss the chance to get a taste of the Delhi Walks experience.\r\n\r\nExplore the Royal Citadel of one of the most fascinating Tughlaq Kings, which got Delhi the title of “City of Djinns.” Explore with Delhi Walks the abode of mystical beings and benevolent djinns.\r\n\r\nThe remaining fort standing in front of Feroz Shah Kotla Stadium was once a part of the 5th city called Ferozabad. This beautiful ruin of a city was once the famous abode of Feroz Shah Tughlaq who shifted the capital from the Southern area to the Northern one because of the scarcity of water. The locals still believe that the Djinns still inhabit the beautiful ruins of Ferozabad. They say that they are benevolent djinns who grant them their wishes.\r\n\r\nDiscover the stories hidden inside the stones of this city which speak of the ruin that befell it when the famous Taimur Lang came here and ransacked and looted the city.\r\n\r\nFeroz Shah Tughlaq was a monarch who went on to build a tremendous amount of schools, colleges and water gardens for the betterment of the populace. Discover the dreams of this fascinating king and relive the lost glory of this city. The royal citadel overlooks the cricket stadium which bears its name, adding to the contrast between the past and present.\r\n\r\nDelhi Walks lives by the mantra ‘See Delhi from an eye of a Delhiite™’, join us as we make this mantra come alive for you. Our years of experience and accolades help us service the best in the city to all travelers. We know the nerve of the city, and let you feel the heartbeat, come with us as we make this a once in a lifetime experience for you.\r\n\r\nFeel free to contact us in order to find out which walk suits you best.\r\n\r\nYou can reach us through email share@delhiwalks.in or call us +91 989 969 2790.',NULL,'',NULL,'2,14,18','MP,walkfestival,heritage,heritagefest,mycity,indorehiddengems','Activities,Artists','3,4,11,21','foot','English,hindi','Guided Tour\r\nStorytelling Experience','Transportation\r\nTransport Charges\r\nMonument Charges\r\nAny kind of personal expenses\r\nShopping\r\nFood etc','Special Tour',NULL,NULL,'Walk','Leader','9172919727','share@cityexplorers.in','9172919727','04:00 PM','05:00 PM','2019-10-11','2019-11-15',NULL,'','','','','','','Gwalior Airport, Gwalior','Indore Junction Bg','Old Famous Jalebi Wala, Paranthe wale Gali, JB kachori Wala, Pt. Ved Prakash Lemon soda, Natraj Dahi Bhalla corner & Giani’s.','1','1','5',NULL,NULL,NULL,'600','','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,NULL,'Image_(3)_1570440710.JPG','Image_(4)_1570440710.JPG','Image_(8)_1570440710.jpg','IMG_5608_1570440711.JPG','1','1','1',NULL,NULL,'5d9b06060e057_Image_(14).jpg',1,1,1,1,1,1,NULL,'2019-10-07 03:53:00',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
(3,2,1,'English','1',NULL,'Indore City',NULL,'Old City Walking Tour',NULL,'Understand the mythological beginnings and historical origins of Lucknow through an exploration of t',NULL,'This walk takes you through some of Old Lucknow’s most stupendous buildings, reveling in the stories of their makers. A short Tonga ride (horse-drawn carriage) will take you into the heart of this epicenter of culture. We explore across its bustling medieval markets, tasting sumptuous delicacies of its refined cuisine and interact with the carriers of the city’s suave mannerisms, whose friendly vibes will make you fall in love with this romantic city.',NULL,NULL,NULL,'2,6,9,18','architecturalnuances,mycitymypride,walk,walkfest2019','Monuments,Street Food','3,11,21','foot','English,hindi','Food\r\nEntry\r\nTonga charges\r\nStoryteller well versed with Lucknow’s heritage','Transportation\r\nTransport Charges\r\nAny kind of personal expenses\r\nShopping','Mini food trail through Lucknow’s oldest gallis - Tundey Kababi or Kallirams Poori-sabzi-Jalebi, Chai, Namash',NULL,NULL,'Walk','Leader','9172919727','share@cityexplorers.in','7291972715','12:00 AM','12:00 AM','2019-10-10','2020-01-18',NULL,'','','','','','','Gwalior Airport, Gwalior','Lucknow City','Old Famous Jalebi Wala, Paranthe wale Gali, JB kachori Wala, Pt. Ved Prakash Lemon soda, Natraj Dahi Bhalla corner & Giani’s.','1','1','5','1','1','8','600','500','[{\"itinerary_additionalcost_description\":\"water bottle\",\"additional_price\":\"20\"}]','',NULL,NULL,'1','1','1',NULL,'https://www.youtube.com/watch?v=ICSFW_YPPB4','Image_(1)_1570444009.JPG','Image_(6)_1570444010.JPG','Image_(3)_1570444010.JPG','Image_(12)_1570444010.jpg','1','1','1',NULL,NULL,'5d9b12e96cee9_Image_(7).jpg',1,1,1,1,1,1,NULL,'2019-10-07 03:58:51',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
(4,3,1,'English','1',NULL,'Bhopal',NULL,'Introduction to Bhopal',NULL,'Explore the history of the Nawabi City',NULL,'The Walk explores the transformation of an engineering marvel of ancient king Raja Bhoj to the administrative capital of the heart of modern day India, through the stunning intervention of small time fortune seeker from Afganisthan and prospered under the pious lady rulers of the always supressed Muslim ladies known as the begums of Bhopal. ',NULL,NULL,NULL,'18','Bhopal','Monuments','41','foot','English','Walk Leader.','Refreshments\r\nTransportations\r\nAnything Else.','Please wear comfortable shoes and carry water bottles.',NULL,NULL,'Sahishnu','Mukherjee','7291972715','cwf.bhopal@gmail.com','7291972715','08:00 AM','10:00 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Gwalior Airport, Gwalior','Bhopal Junction','Upper lake, Lower lake, Kamlapati Mahal, Sadar Manzil and Khirniwala maidan','1','1','20',NULL,NULL,NULL,'50','','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'https://youtu.be/o-BevEO1iIg ','Iqbal_Maidan_1570449432.jpg','Iqbal_Maidan_1570449433.jpg','Iqbal_Maidan_1570449434.jpg','Iqbal_Maidan_1570449435.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,6,NULL,'2019-10-07 05:27:12',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
