(6,14,1,'English','1',NULL,'Bhopal',NULL,'Introduction to Bhopal',NULL,'Tales of the Nawabi City!',NULL,'The Walk is led by Sahishnu Mukherjee.\r\n\r\nExplores the transformation of an engineering marvel of ancient king Raja Bhoj to the administrative capital of the heart of modern day India, through the stunning intervention of small time fortune seeker from Afganistan and prospered under the pious lady rulers of the always supressed Muslim ladies known as the begums of Bhopal. ',NULL,'',NULL,'18,19','Bhopal,Heritage,Walk','Monuments,Parks,Lakes','33,41','foot','English,hindi','Guided Walk','Refreshments\r\nTransportations\r\nOr any other items.','Wear comfortable shoes and conservative clothes as we may enter religious places.',NULL,NULL,'City','Explorers','9811292557','help@cityexplorers.in','9958694376','07:00 AM','12:00 PM','2019-10-12','2019-10-13',NULL,'','','','','','','Raja Bhoj International Airport','Bhopal Junction','Upper lake, Lower lake, Kamlapati Mahal, Sadar Manzil and Khirniwala maidan',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'https://youtu.be/o-BevEO1iIg ','Banner_2_(1)_1570524115.jpg','IMG_20180909_085036072_BURST002_1570484114.jpg','IMG_20180909_090656437_1570484114.jpg','IMG_20180908_064618942_HDR_1570484115.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,6,NULL,'2019-10-08 02:11:55',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(7,2,1,'English','1',NULL,'Bhopal',NULL,'Introduction to Bhopal',NULL,'Tales from the city of Nawabs!',NULL,'This walk will be lead by Sahishnu Mukherjee.\r\n\r\nThe walk will explore the transformation of an engineering marvel of ancient king Raja Bhoj to the administrative capital of the heart of modern day India, through the stunning intervention of small time fortune seeker from Afganistan and prospered under the pious lady rulers of the always supressed Muslim ladies known as the begums of Bhopal. \r\n\r\nCome and enjoy the fascinating history of Bhopal.',NULL,NULL,NULL,'18,19','Bhopal,Heritage,Walk','Monuments,Lakes,parks','41','foot','English,hindi','Guided Walk','Refreshments,\r\nTransportation,\r\nOr Any Other Expense.','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','06:00 AM','11:00 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Raja Bhoj International Airport','Bhopal Junction','Upper lake, Lower lake, Kamlapati Mahal, Sadar Manzil and Khirniwala maidan',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','Banner_1_1570527849.jpg','Iqbal_Maidan_1570527849.jpg','IMG_20180909_090656437_1570527849.jpg','IMG_20180908_064653920_HDR_1570527850.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 03:14:09',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(8,2,1,'English','1',NULL,'Gwalior',NULL,'Gwalior Fort Walk',NULL,'Exploring the mighty fortress!',NULL,'The Walk will be lead by Dr. C.S. Barua.\r\nGwalior Fort has existed at least since a long time, and the inscriptions and monuments found within are full of interesting stories which must be explored by everyone.',NULL,'',NULL,'18','Gwalior,Heritage,Walk','Fort,History','41','foot','English,hindi','Guided Walk','Refreshments\r\nTransportation\r\nOr any other expense.','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','08:30 AM','11:00 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Rajmata Vijaya Raje Scindia Airport, Gwalior','Gwalior','Gwalior Fort.',NULL,NULL,NULL,'1','1','20','','1','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','1_1570533037.jpg','20181007_073854_1570528950.jpg','20181007_081711_1570528950.jpg','20181007_090236_1570528951.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 04:40:37',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(9,2,1,'English','1',NULL,'Khajuraho',NULL,'Lakshamana Temple Walk',NULL,'A Milestone in Chandela History!',NULL,'The walk is lead by Anurag Shukla.\r\nIn this walk, the guests will get historical background of Lakshmana temple and then they will visit and see the details of temples. They will get a chance to see, erotic art of Khajuraho in different part of the temple, explanation of beautiful apsaras, surasundaris and shalabhanjika. Also, they will witness the inscription of King Yashovarman, who constructed the Lakshmana temple. ',NULL,'',NULL,'18','Khajuraho,Heritage,Walk','temple,Architecture','41','foot','English,hindi','Guided Walk','Entry Ticket\r\nRefreshments\r\nTransportation\r\nany other expense','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','08:30 AM','11:00 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Civil Aerodrome, Khajuraho','Khajuraho','Lakshamana Temple',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','1_1570532902.jpg','20180927_094537_1570529735.jpg','IMG-20180927-WA0002_1570529735.jpg','IMG-20180909-WA0039_1570529735.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 04:38:22',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(10,2,1,'English','1',NULL,'Chanderi',NULL,'Glimpses of Chanderi',NULL,'Our Heritage, Our Identity!',NULL,'The walk will be lead by Manoj Soni.\r\nThe Walk takes you around the historical town of Chanderi to get mesmerized by the stories and heart uplifting views.',NULL,'',NULL,'18','Chanderi,Heritage,Walk','Monuments','41','foot','hindi','Guided Walk','Transportation\r\nRefreshments\r\nEntry Tickets\r\nAny other expense','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','07:00 AM','12:00 PM','2019-10-12','2019-10-12',NULL,'','','','','','','Rajmata Vijaya Raje Scindia Airport, Gwalior','Lalitpur','Badal mahal gate, Tombs of Nizamuddin family, Oontsar, Khuni Darwaza, Narsingh Mandir, Chaubisi Jain Mandir.',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','1_1570532974.jpg','BADAL_MAHAL_DARWAZA,_CHANDERI_1570531067.jpg','IMG_20180713_082600998_1570531068.jpg','IMG_20180713_081953341_HDR_1570531068.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 04:39:34',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(11,2,1,'English','1',NULL,'Orchha',NULL,'Orchha Heritage Experience (On Cycle)',NULL,'Explore Heritage and nature of the ancient Orchha',NULL,'The Walk and Cycle Tour is lead by Manohar Lal Kewat.\r\nThe historical settlement derived its name from the phrase \'Ondo chhe\' meaning \'low\' or \'hidden\'. The site was indeed bowl-like, buffered by bluffs and forests, lying on the Betwa River. Orchha was founded in the 16th century by the Bundela chief Rudra Pratap Singh, who became the first King of Orchha.',NULL,NULL,NULL,'Heritage','Orchha,Cycle,Tour','Cycling','41','cycle','hindi','Guided Cycle Tour / Walk','Cycle Rent Cost\r\nRefreshments\r\nTransportation\r\nAny other expense','The Experience is being conducted as part of City Walks Festival Madhya Pradesh 2019.',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','06:00 AM','10:30 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Rajmata Vijaya Raje Scindia Airport, Gwalior','Gwalior','Old Temples, Monuments and Palace Complex.',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','1_1570535956.jpg','IMG-20180714-WA0038_1570535956.jpg','IMG-20181006-WA0027_1570535956.jpg','IMG-20180716-WA0012_1570535956.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 05:29:16',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(12,2,1,'English','1',NULL,'Indore',NULL,'Women in Indore’s history ',NULL,'Tracing the contribution by women',NULL,'The walk will be lead by Shravaani.\r\nIndore, a vibrant city with a unique blend of modernity and tradition, in its history before independence of, 220 years had many strong women - queen, princesses, regents, who played a major role in shaping the course of history of Indore State. This walk and talk, goes deep into history and throws light on the contribution of these women in history of pre-independence Indore.',NULL,NULL,NULL,'19','Indore,Heritage,Walk','Monuments,architecture','41','foot','English,hindi','Guided walk \r\n','Transportation \r\nRefreshments\r\nAny other expense\r\n','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','06:00 AM','12:00 PM','2019-10-12','2019-10-12',NULL,'','','','','','','Devi Ahilya Bai Holkar international Airport','Indore Junction Bg','Boliya Sarkar ki Chhatri, Krishna Pura Chhatris, Banke Bihari Mandir and statue of Devi Ahalya.',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','2_1570542232.jpg','Indore_Krishnapura_Chhatri_1570542232.JPG','Rajwada-Indore_1570542233.jpg','IMG_5657_1570542233.JPG','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 07:13:52',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
(13,2,1,'English','1',NULL,'Vidisha',NULL,'Exploring Ancient Vidisha',NULL,'A heritage walk back in time',NULL,'The Walk is lead by Arvind Sharma.\r\nThe town of Besnagar, 3 km from present-day Vidisha on the west side of the river, became an important trade centre in the 6th and 5th centuries BCE, under the Shungas, Nagas, Satavahanas, and Guptas, and was mentioned in the Pali scriptures. The Emperor Ashoka was the governor of Vidisha during his father\'s lifetime. His Buddhist Empress Vidisha Devi who was also his first wife was brought up in Vidisha. It finds mention in Kalidasa\'s Meghdoot. Explore this part of ancient city on this walk.',NULL,'',NULL,'18','Vidisha,Heritage,Walk','Monuments','33','foot','hindi','Guided Walk','Transportation\r\nRefreshments\r\nAny other expense','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','06:00 AM','11:00 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Raja Bhoj International Airport','Vidisha','Heliodorus Pillar & Triveni Ghat.',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','chau_Khambe_1570546742.JPG','IMG-20180927-WA0081_1570543109.jpg','chau_Khambe_1570543109.JPG','Hindola_Toran_1570543110.JPG','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 08:29:02',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
(14,2,1,'English','1',NULL,'Panna',NULL,'Tracing the architecture of Baldevji Temple ',NULL,'Celebrating the indo-saracenic architecture of panna. ',NULL,'The walk will be lead by Shivaditya Singh.\r\nThe second half of the 19th century panna was highly influenced by the greco-roman architecture AKA indo-saracenic architecture.The century also witnessed the architectural synthesis of indian (jalies and chattries) with the European elements like classical columns, large size vanatian windows and the symmetrical structure which can precisely seen in the 19th century public buildings of panna. #Mr Menle,who wan an italian born and was a state architect in the Court of H.H Mahendra maharaja sir.rudra pratap singh of panna, was the hand behind in bringing the colonial elements in public edifices.hence they were adorned and prittified by the claasical beauty of the renowned west civilizations.',NULL,NULL,NULL,'2','Panna','temple','41','foot','English,hindi','Guided Walk','Refreshment\r\nTransportation\r\nAny other expense','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','07:00 PM','10:00 PM','2019-10-12','2019-10-12',NULL,'','','','','','','Civil Aerodrome, Khajuraho','Khajuraho','Baldev Ji Temple',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','1_1570544117.jpg','IMG_20180913_113441_1570544117.jpg','IMG_20180913_113159_1570544117.jpg','IMG_20180913_114116_1570544118.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 07:45:17',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
(15,2,1,'English','1',NULL,'Gwalior',NULL,'Musical strings of Gwalior',NULL,'A trail through the tomb of Tansen',NULL,'\r\nThe Walk will be lead by Saloni Sharma.\r\n\"Gwalior is honored to be known as the land of music. There is a local saying in the city that even a child on birth cries musically. It has music in its roots. It has given birth to some of the greatest musicians of the country: Raja Mansingh Tomar, Mian Tansen, Ustad Nathan Pir Baksh, Pandit Shankar Rao Pandit, Ustad Nissan Hussain Khan, Ustad Amjab Ali Khan and the list continues making the musical strings of Gwalior immortal. Tansen Tomb or Muhammad Ghaus Tomb in Gwalior is one of the most beautiful gems of Gwalior. Muhammad Ghaus was the master of Mian Tansen and a Sufi saint besides whose tomb is the tomb of legendary vocalist Tansen. The premises also gives home to the tomb of family members of Muhammad Ghaus. This place is a beautiful piece of architecture and has huge lush green gardens in the premises.\r\nAnnual Tansen music festival is held here every year in the month of November-December where prominent musicians from all over the country come and perform various classical shows.\"\r\n',NULL,NULL,NULL,'2,Music','Gwalior,Heritage,Walk','Monuments','41','foot','English,hindi','Guided Walk','Transportation\r\nRefreshments\r\nEntry Tickets','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','04:00 PM','06:00 PM','2019-10-12','2019-10-12',NULL,'','','','','','','Rajmata Vijaya Raje Scindia Airport, Gwalior','Gwalior','Tansen Tomb and Tomb of Muhhamad Ghaus',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','2_1570544693.jpg','IMG_0417_1570544693.jpg','IMG-20190310-WA0049_1570544694.jpg','IMG20190310122159_1570544694.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 07:54:53',1