(16,2,1,'English','1',NULL,'Burhanpur',NULL,'Tapti to Utawali ',NULL,'A riverside heritage walk',NULL,'The walk will be lead by Qaiseruddin Sheikh. Join the walk to explore the gems of Burhanpur, the city which is the gateway to South.',NULL,NULL,NULL,'18','Burhanpur,Heritage','Monuments','41','foot','hindi','Guided Walk','Transportation\r\nRefreshments\r\nAny other Expense','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n\r\n\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','09:00 AM','12:00 PM','2019-10-12','2019-10-12',NULL,'','','','','','','Devi Ahilya Bai Holkar international Airport','Burhanpur','RAMJHAROKHA TEMPLE, ADIL SHAH KA MAQBARA, TOTA MAINA , BEGAM SUJA KA MAQBARA, SHAHNAVAZ KHAN KA MAQBARA, ROKADIYA HANUMAN MANDIR',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','1_1570545539.jpg','004_ram_jharoka_mandir_01_1570545539.jpg','006_aadil_shah_ka_makbara_01_1570545539.jpg','011_water_spot_1570545539.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 08:08:59',1,NULL,'12/10/2019',60,0,NULL,0,0,1,1,'regular',''),
