(18,2,1,'English','1',NULL,'Jabalpur',NULL,'British Residency Walk',NULL,'Revisiting Colonial Past',NULL,'The walk will be lead by Upendra Yadav.\r\nJoin the walk to explore some of the iconic spots of colonial jabalpur.',NULL,NULL,NULL,'18','Jabalpur','Monuments,church','41','foot','hindi','Guided Walk','Tranportation\r\nRefreshments\r\nAny other expense','The Walk is being conducted as part of City Walks Festival Madhya Pradesh 2019.\r\n\r\n',NULL,NULL,'Walk','Leader','7291972715','share@cityexplorers.in','7291972715','07:00 AM','11:00 AM','2019-10-12','2019-10-12',NULL,'','','','','','','Daman Airport, Jabalpur','Jabalpur','Kalchuri Hotel, Commisioner House, St. Thomas Church, Bishop House, Garrison Ground, Kargil Memorial, World War II Memorial.',NULL,NULL,NULL,'1','1','20','','50','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'','TilwaraGhat_1570547989.JPG','St_1570547990.jpg','St_15705479901.jpg','St_15705479902.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2019-10-08 08:49:49',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
