(24,16,3,'English','18',NULL,'New Delhi',NULL,'Delhi Shopping Trail',NULL,'Shop till you drop!',NULL,'Every city in India has a large number of shopping places housing everything from local brands to international showrooms. Besides shopping malls and shopping centres, there are many local markets some of which are one of the best in the country and in Asia as a whole.\r\nOur insider shopping tours are designed to provide travellers with behind the scenes shopping experience\r\nBesides innumerable shopping malls and super marts, people in India frequently visit the real original markets, where you can get everything from ethnic jewellery to traditional dresses like Lehnga Chunri and decorative pieces. These colourful markets will always have something that one won’t find in the modern day malls.\r\nEven though every city on its own is famous and unique for something and have their own range of exciting colourful markets, some of the best and most famous bazaars of India belong to cities like Delhi, Jaipur, Kannauj, Hyderabad, Shimla, Srinagar, Imphal, Cochin, Goa and Mumbai.',NULL,'Indoor',NULL,'38','Delhi,Shopping','markets','38','car','English','Transportation','Refreshments','Our insider shopping tours are designed to provide travellers with behind the scenes shopping experience.',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','09:00 AM','07:00 PM','2019-12-03','2020-01-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','New Delhi','Connaught Place, Chandni Chowl, Dilli Haat, Sarojini Nagar Market, Hauz Khas & Saket.','1','1','5','1','1','20','2000','1200','[{\"itinerary_additionalcost_description\":\"Water Bottles\",\"additional_price\":\"50\"}]','',NULL,NULL,'1','1','1',NULL,'https://youtu.be/o0XVHKLrh_w','IMG_20171119_154804597_HDR_1575364077.jpg','IMG_20180510_180413580_HDR_1575360258.jpg','IMG_20170425_185132_1575360259.jpg','IMG_20180510_192419060_HDR_1575360259.jpg','1','1','1',NULL,NULL,'',1,1,