(25,16,2,'English','14',NULL,'New Delhi',NULL,'Dastaan E Delhi',NULL,'Story of India\'s capital city',NULL,'There’s no better way to experience the cities than to get on your feet, on the ground, and just walk. We prepare our walking itineraries in such way that they let you explore the cities like a local, deep down into the lives of the indigenous. The best part about our walking tours is that you can do it your own way and at your own pace, in a group with an explorer or choose from the various independent options.\r\nWe strive to exceed your expectations and make our walks even better every time and try our best to make your visit the most memorable one.',NULL,NULL,'Indoor','19','Delhi','Culture','41','online','English','Stories','Refreshments\r\n','Limited Slots. First Come, First Serve basis.',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','08:00 AM','07:00 PM','2019-12-03','2019-12-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','New Delhi',NULL,'1','1','10','1','1','20','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'https://youtu.be/o0XVHKLrh_w','IMG_5534_1575362707.JPG','IMG_20180502_084542_1575362708.jpg','IMG_1828_1575362708.JPG','20180803_171216_1575362708.jpg','1','1','1',NULL,NULL,'5de62093f0706_sponsor_01.jpg',1,1,1,1,1,5,NULL,'2019-12-03 02:15:07',1,NULL,NULL,60,0,NULL,0,0,1,1,'nonregular','19-12-2019, 20-12-2019, 21-12-2019, 22-12-2019, 24-12-2019, 23-12-2019, 26-12-2019, 27-12-2019, 28-12-2019, 29-12-2019, 30-12-2019, 04-12-2019, 05-12-2019, 06-12-2019, 07-12-2019, 08-12-2019, 09-12-2019, 10-12-2019, 11-12-2019, 12-12-2019, 13-12-2019, 14-'),
(26,16,4,'English','53',NULL,'New Delhi',NULL,'Heritage Conference - India',NULL,'Discussing the culture around us',NULL,'Contemporary India’s increasing physical prosperity and cultural dynamism—despite continued domestic challenges and economic inequality—are seen in its well-developed infrastructure and a highly diversified industrial base, in its pool of scientific and engineering personnel (one of the largest in the world), in the pace of its agricultural expansion, and in its rich and vibrant cultural exports of music, literature, and cinema. Though the country’s population is largely rural, India has the most populated cosmopolitan cities of the world – Kolkata, Mumbai, Delhi and Bangalore.',NULL,NULL,'Indoor','18','Delhi,Heritage','Discussions,Debates','33,Documentary','virtual','English','Refreshments','Transportation','Speakers panel are selected independently. ',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','09:00 AM','08:00 PM','2019-12-03','2019-12-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','New Delhi',NULL,'1','1','10','1','1','20','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,NULL,'DSC_2955_1575363769.JPG','IMG_2427_1575363769.JPG','IMG_3037_1575363769.JPG','IMG_7124_1575363769.JPG','1','1','1',NULL,NULL,'5de624b913ce5_sponsor_01.jpg',1,1,1,1,1,5,NULL,'2019-12-03 02:32:49',1,NULL,NULL,60,0,NULL,0,0,1,1,'nonregular','03-12-2019, 04-12-2019, 05-12-2019, 06-12-2019, 09-12-2019, 10-12-2019, 11-12-2019, 13-12-2019, 12-12-2019, 16-12-2019, 17-12-2019, 18-12-2019, 19-12-2019, 20-12-2019, 23-12-2019, 24-12-2019, 25-12-2019, 27-12-2019, 26-12-2019, 30-12-2019, 31-12-2019'),
(27,16,3,'English','17',NULL,'New Delhi',NULL,'Delhi Cookout Experience',NULL,'Learning Indian Style of Cooking',NULL,'Staple foods of Indian cuisine include pearl millet (b?jra), rice, whole-wheat flour (a??a), and a variety of lentils, such as masoor (most often red lentils), tuer (pigeon peas), urad (black gram), and moong (mung beans). Lentils may be used whole, dehusked—for example, dhuli moong or dhuli urad—or split. Many of the most famous ingredients used to make typical \'Indian\' cuisine aren\'t actually native to India. The traditional food of India has been widely appreciated for its fabulous use of herbs and spices. Indian cuisine is known for its large assortment of dishes.',NULL,'Indoor',NULL,'20','Delhi,cooking,indian,food','cooking','38','car,foot','English','Refreshments, Food Expert','Drinks','Learn cooking from an expert and buy your ingredients from a local market.',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','09:00 AM','07:00 PM','2019-12-03','2019-12-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','New Delhi','Chandni Chowk & Khari Baoli','1','1','10','1','1','20','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'https://youtu.be/o0XVHKLrh_w',NULL,NULL,NULL,NULL,'1','1','1',NULL,NULL,NULL,1,1,1,1,1,6,NULL,'2019-12-03 03:21:22',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
(28,16,1,'English','2',NULL,'New Delhi',NULL,'Street Food Tour in Shahjahanabad',NULL,'The Multicultural Taste of Old Delhi',NULL,'STREET FOOD WALKS are curated to offer you local experiences. We are passionate about diverse local cuisines which is integrated with culture and people. Local food and beverages are the main highlights of our street food walks. With a mission to offer engaging interactions with local cultures and with Sachin Bansal as the Chief Explorer and Founder, ‘India City Walks’ is already redefining the art of showcasing travel and tourism excellence of India local experience to the world.\r\nLooking to ditch the capital city’s crowded pubs and cafes? Join us on an offbeat culinary trail through the scintillating alleys of Shahjahanabad, the seventh Delhi where you can eat to your heart’s delight.\r\nEager to delve into Old Delhi’s culinary delights but don’t know where to begin? Enjoy specially curated street food trails that run all day in Shahjahanabad, the ‘seventh’ city of Delhi and the ultimate destination for a gastronome. ',NULL,NULL,NULL,'16','Old,Delhi,Shahjahanabad','Street Food','11,21','foot','English','Food Tasting\r\nGuide\r\n','Transportation\r\nEntry Tickets','Witness Old Delhi’s tapestry of diverse cultures and mouth-watering cuisines come alive at night and immerse yourself in this charismatic city’s intoxicating charm on a specially curated night food tour by ‘India City Walks’. We can’t think of a better way indulge in the history, culture and local cuisines of a spectacular heritage city. Experience a night food trail with at least 15+ tasting stops that will redefine your understanding of the city’s top-notch culinary destinations!',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','08:00 AM','08:00 PM','2019-12-26','2020-01-15',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Delhi','Dariba Kalan, Kinari Bazaar, Khari Baoli.','1','1','10','1','1','20','3000','2500',