(29,16,2,'English','14',NULL,'New Delhi',NULL,'8 Cities of Delhi',NULL,'Story of India\'s capital city',NULL,'Delhi Walks is a passionate endeavour to make the bygone eras come alive through various remnants of the past scattered across the city. Our walks are tailored to suit your interests for a perfect introduction to the eternal City of Cities. Our experienced and knowledgeable Walk Leaders® are driven to showcase the heart of Delhi. Experience the unique itineraries which assure fascinating and fun-filled memories. So, don’t miss the chance to get a taste of the Delhi Walks experience.\r\n\r\nThis walk gives you the opportunity to explore the first city to be ever built in Delhi. Explore the monuments belongings to the first city and those which were added later in Mehrauli Archaeological Park.\r\n\r\nSpend your early morning to get a chance to get out without being bothered by the sweltering heat. Indulge in a perfectly curated experience that introduces you to the best aspects of architecture from the medieval to modern times. Mehrauli Archaeological Park also allows a stupendous view of the Qutub Minar in the distance. Explore the open 200-acre stretch studded with flora and fauna with dotted Architectural marvels built over centuries.',NULL,NULL,'Indoor','41','delhi,history,City,of,Cities','history','audio,visuals','online','English','Storytelling','Refreshments\r\nTransportation','Trace the fascinating story of the 8 cities of Delhi because of which it is known as the “city of cities.” This is a serene and breathtaking walk that is composed of nature, history, and heritage. Don’t miss your chance to explore this beautiful part of Delhi.',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','08:00 AM','08:00 PM','2019-12-26','2020-01-15',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Delhi',NULL,'1','1','10','1','1','30','2500','1800','[{\"itinerary_additionalcost_description\":\"\",\"additional_price