(30,16,3,'English','37',NULL,'New Delhi',NULL,'SPIRITUAL CORNERS OF OLD DELHI',NULL,'SPIRITUAL CORNERS OF OLD DELHI',NULL,'Enjoy a detailed storytelling session as you walk through lanes and alleys with Delhi walks and visit the places that speak volumes for the evolution of this Mughal era Walled City and its evolution through the ages. Visit the Architectural marvel which at once was the largest mosque of Asia built during the 17th Century by the famous mughal Emperor Shah Jahan, it also served as a model for other mosques built in the following years by various other patrons.\r\n\r\nAs you walk with Delhi walks in the city get to know interesting details about various structures within the old part of Delhi and interesting stories related to them along with market places like Meena Bazaar which was initially a Royal market for Ladies catering to their demands and needs. Visit the peaceful Jain Digambhara Temple located right opposite to the Red fort, the temple also has a Bird Hospital within its premises. Walk through the market lanes of Chandni Chowk, and witness one of the biggest wedding accessories market at Kinari Bazaar, the never ending jewelers market at Dariba Kalan.',NULL,'Outdoor',NULL,'36','Old,Delhi','shrines,Temples,Mosque,Gurudwara,Church','41','foot','English','Storytelling','Refreshments\r\nTransportation','The city of Shahjahanabad is a space where past and present coexists in the most harmonious way like nowhere else. On our Old Delhi travelogue tour, you get to experience the city through the eyes of various travellers over the centuries.',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','08:00 AM','08:00 PM','2019-12-26','2020-01-15',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Delhi','Jain Temple, Church, Jama Masjid, Hindu Temple & Gurudwara','1','1','10','1','1','20','3000','2500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'<iframe width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/vWn8F0VBa70\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','IMG_1001_1577341321.JPG','IMG_3569_1577341321.JPG','IMG_3545_1577341321.JPG','IMG_3577_1577341321.JPG','1','1','1',NULL,NULL,NULL,1,1,1,1,1,5,NULL,'2019-12-26 11:52:01',1,NULL,NULL,60,0,NULL,0,0,1,1,'regular',''),
(31,16,4,'English','25',NULL,'New Delhi',NULL,'Delhi Heritage Meetup',NULL,'Let\'s talk with the past',NULL,'Gear up to make new friends and gain new experiences with Delhi Walks. Experience our specially crafted Group Walks to various places in Delhi. Want to share this experience, join a like-minded group or make your own group to take a walk around this imperial city and we at Delhi Walks will make sure you have the best time with our carefully designed tours. Whether it is sightseeing at Red Fort, Purana Qila, Hauz Khas, Tughlaqabad fort, Humayun’s tomb, or historical walk and Cultural around Old Delhi-Chandini Chowk area, shopping and food around Old Delhi for best street food experience or elite dining experience in boutique restaurants and bars and night life experience at the best bars, pubs and discos for amazing dance, live music and food- we offer you to choose from a wide array of themes. You can join us at Delhi Walks for guided walks that best exhibits the diversity and plurality of Delhi. For a wholesome experience and a walking that leaves you enthralled, informed and enthusiastic join Delhi Walks. You may choose to take up these themes as group or private walk.\r\nWe are expert in walking tours and we’ve earned a solid reputation for our passion, enthusiasm and importantly, our sense of showcasing the character of the city.',NULL,NULL,'Outdoor','18','Delhi,Meetup','Monuments','activities','online','English','Stories','Refreshments\r\nTransportation','Our team of City Explorers are unsurpassed in knowledge and ensure that your walking tour exceeds your expectations.',NULL,NULL,'Shrawan','Chinchwadkar','7291972713','sales@indiacitywalks.com','7291972715','08:00 AM','08:00 PM','2019-12-26','2020-01-15',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','New Delhi',NULL,'1','1','10','1','1','20','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,NULL,'Pic_(3)_1577342