(32,15,3,'English','32',NULL,'Agra',NULL,'Timeless History: Touring Taj Mahal and Agra Fort',NULL,'Love it the Shahjahan-Mumtaz Way',NULL,'Agra was the first primary capital of the Central Asian Mughal Empire. Celebrated for its beauty, the spot makes a space for both, a visual and an enthusiastic encounter. The visit starts the Taj Mahal. An amazing aesthetic wonder of plan and development, the landmark is emblematic of Shah Jahan\'s commitment and love to his better half, Mumtaz Mahal, for whom the structure was made. Developed in ivory-white marble, this catacomb lays on the Southern banks of the stream Yamuna. The visit will take you further to investigate the eminent Agra Fort worked by the third Mughal relative Jalal-ud-clamor Muhammad Akbar in 1565. While augmentations to the structure kept on being made in the later years, the red sandstone looks as alive today as it did during the rule of Akbar which denoted the culmination of the Mughal realm. The Agra Fort was constructed before the Mughals moved their capital from Agra to Delhi. Subsequently, the Red Fort in New Delhi was based on similar lines and is actually, somewhat like the one implicit its neighboring city.`',NULL,'Outdoor',NULL,'2,18,Art','Agra,Experience,Tour,Mughals,Taj,Mahal,India,History,Tourism,World,Heritage,Site','History,monuments,garden,Tomb,fort,photographs','22,41','car,foot','English','Transportation, Storytelling, Water Bottles.','Entry Tickets, Refreshments.','Experience Agra & Mughal Glory in the city like never before.',NULL,NULL,'Shivam','Verma','7291972715','explore@cityexplorers.in','7291972715','08:00 AM','08:00 PM','2020-01-18','2020-03-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Agra Cantt','Taj Mahal & Agra Fort','1','1','4','1','5','15','3000','2000','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'<iframe width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/QeZrxCW21BM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','india-1961216_1920_1579339712.jpg','1_1579339712.jpg','2_1579339712.jpg','3_1579339712.jpg','1','1','1',NULL,NULL,NULL,1,1,1,1,1,5,NULL,'2020-01-18 02:58:32',1,5,NULL,60,1,NULL,0,0,1,1,'regular',''),
(33,15,1,'English','2',NULL,'Agra',NULL,'Spiced Agra\'s Food and Culture',NULL,'Let the foodie in you come alive with this food walk',NULL,'\"Strolling down the paths of Agra leaves one consumed by the fragrance of the various flavors, different nourishment slows down and the general assorted foods of the city. Be it while taking a gander at the exceptionally old zest shops at Rawatpada or eating the scrumptious and popular lamb stew at Pakiza Meat Shop, it is a marvel how various flavors and flavors mix into the living history of the city, and how current changes to the first dishes after some time have made new flavors that still hold the social noteworthiness of the dish. Go along with us on a nourishment visit over the old city as we take you through a voyage of heap palates, with a wide range of dishes going from Mughlai non-vegan cooking to braj ke bhalle, and talk about how the various flavors/arrangements utilized by ages have impacted the nourishment and living society of the city. \r\n',NULL,NULL,NULL,'Food,Culninary,culture','Agra,Food,Tour','Street,food,flavours,spices,Photography','1,22,41','foot','English','City Explorer, Storytelling, Food Tasting.','Transportation','Enjoy a memorable food tour in the Mughal City of Agra.',NULL,NULL,'Shivam','Verma','7291972715','explore@cityexplorers.in','7291972715','08:00 AM','08:00 PM','2020-01-18','2020-03-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Agra City','Rawatpara, Seb Ka Bazar, Hing ki mandi, Pakiza Meat Shop, Braj ke Bhalle, Manoj Restaurant.','1','1','4','1','5','15','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'<iframe width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/QeZrxCW21BM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','image_1579340573.jpg','1_1579340573.jpg','2_1579340573.jpg','3_1579340573.jpg