(34,15,1,'English','1',NULL,'Agra',NULL,'Agra in Poetic Heritage',NULL,'Let the verse of Agra be infused ',NULL,'\"Perusing the writers of Agra can cause one to understand that language isn\'t a boundary however a device to set up human associations. Be it Nazir Akabarabadi, Ghalib, or Mir Taqi Mir, the city and its way of life has been archived flawlessly in wonderful sections. This convention has proceeded with new artists rising and developing from various dialects and networks. \r\nCome along with us on this verse stroll over the old city as we visit the origin of some incredible writers, read and discussion about the verse of Agra, and attempt to comprehend the submergence of language inside the city\'s one of a kind social extravagance. ',NULL,NULL,NULL,'Poems,tradition,Literature','Agra,Walk','Poems,poets,Biograpghy,Photograpghy,languague,literature','41,History','foot','English','City Explorer, Storytelling.','Refreshments, Trasportations.','Revisit the glory days of Agra through poems.',NULL,NULL,'Shivam','Verma','7291972715','explore@cityexplorers.in','7291972715','08:00 AM','08:00 PM','2020-01-18','2020-03-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Agra Cantt','Jama Masjid, Kala Mahal, Nazir Akbarabadi Birthplace, Maikash Akbarabadi Tomb, Mantola','1','1','4','1','5','15','1500','1000','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'<iframe width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/QeZrxCW21BM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','image_1579341460.jpg','2_1579341460.jpg','2_15793414601.jpg','2_15793414602.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2020-01-18 03:27:40',1,5,NULL,60,1,NULL,0,0,1,1,'regular',''),
(35,20,1,'English','1',NULL,'Agra',NULL,'Walking in Sikandra- Emperor Akbar\'s Tomb',NULL,' Pay a tribute to one of India\'s finest rulers',NULL,'\"Akbar, the third Mughal sovereign, administered India for a long time. He was known to be a thoughtful ruler, an extraordinary warrior and a craftsmanship sweetheart, and furthermore an adherent to balance and harmony, driving his realm to vanquish one - third of the world\'s riches. \r\n\r\nThe landmark of Sikandra in Agra (recently known as Akbarabad, or the place that is known for lord Akbar) is the last resting spot of the ruler. It is a fine case of Mughal design and was worked during the pinnacle of the Mughal rule. Throughout the walk, we will discuss Akbar\'s life and convictions, Mughal aesthetics, the historical backdrop of the landmark and investigate the greenery of the leftovers of the city woods. We will encounter the serenity and harmony the landmark brings out, read some verse and tune in to the flute as well.\"\r\n',NULL,NULL,NULL,'Heritage,Art,architecture','Agra,Heritage,History,Tour','monument,photographs,garden,tomb','22,41','foot','English','Storyteller','Transportation, Refreshments, Entry Tickets.','Experience Agra through stories.',NULL,NULL,'Dr. Sachin','Bansal','9711190192','sb@cityexplorers.in','7291972715','08:00 AM','08:00 PM','2020-01-18','2020-03-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Agra Cantt','Akbar\'s Tomb','1','1','4','1','5','20','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'<iframe width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/QeZrxCW21BM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','image_1579343389.jpg','1_1579343389.jpg','3_1579343389.jpg','2_1579343389.jpg','1','1','1',NULL,NULL,'',1,1,1,1,1,5,NULL,'2020-01-18 03:59:49',1,5,NULL,60,1,NULL,0,0,1,1,'regular',''),
(36,20,1,'English','1',NULL,'Agra',NULL,'Walking through Old Agra',NULL,'Let Old Agra speak to you the stories unsaid',NULL,'You will begin this visit by walking, at the memorable rail station, which is one of the most punctual railroad frameworks in the nation. This vital Raj building was developed in 1891 as a stay site for pioneer sightseers visiting Agra. Over the station, somewhere down in the very heart of the city, calmly stands the Jama Masjid, a fascinatingly designed mosque, worked in 1648 by Shah Jahan\'s preferred girl, Jahanara Begum. Directly inside the mayhem of Old Agra, you will go through Vaidya Ramdutta Gali, a noteworthy path devoted to the memory of a customary prescription specialist. From here, your guide will take you to the Chidiyawala Temple, the zest showcase and the Patal Hanuman Temple. You will stroll through the Mughal police headquarters and Kinari bazaar (diamond setters showcase) as well.\r\n',NULL,NULL,NULL,'art,architecture,heritage','Agra,Old,City,Tour,Heritage,History,Culture','monuments,Markets,streets,lanes,History,Photographs','41','foot','English','Storyteller','Refreshments, Transportation.','Explore Old Lanes of Agra for an immersive experience in the city.',NULL,NULL,'Dr. Sachin','Bansal','9711190192','sb@cityexplorers.in','7291972715','08:00 AM','08:00 PM','2020-01-18','2020-03-31',NULL,'','','','','','','Indira Gandhi International Airport, Delhi','Agra Fort','Agra Fort Railway Statio, Jama Masjid, Vaidya Ramdutta Gali, Chidiyawala Temple, Spice Market, Patal Hanuman Temple, Kinari Bazar.','1','1','4','1','5','20','2000','1500','[{\"itinerary_additionalcost_description\":\"\",\"additional_price\":\"\"}]','',NULL,NULL,'1','1','1',NULL,'<iframe width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/QeZrxCW21BM\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','image_1579343980.jpg','1_1579343980.jpg','2_1579343980.jpg','3_1579343980.j