ble local laws.</p><h4>Professional Ethics</h4><p>The Operator shall always adhere to professional ethics. When dealing with Travellers, the Operator shall:</p><ol class=\"lower-alpha\"><li>be dutiful, sincere, courteous and attentive;</li> <li>speak and act cautiously, discreetly, and be objective in his/her/their attitude;</li> <li>be knowledgeable about the tangible and intangible heritage of the city in addition to the history of the city;</li> <li>provide the Travellers with true and accurate information;</li> <li>respect the religious belief, customs and habits of the Travellers;</li> <li>not make any seditious comments or remarks;</li> <li>not make any political comments or remarks;</li> <li>not make any blasphemous comments or remarks;</li> <li>be punctual in performing duties;</li> <li>not smoke in front of the Travellers and/or drink alcohol during work;</li> <li>not conduct any activity while intoxicated;</li> <li>not gamble during work;</li> <li>not make use any abusive language and/or remarks during work;</li> <li>not make any obscene comments or remarks;</li> <li>not sell illicit items to the Travellers or recommend them to buy such items; </li> <li>not seize or take away or attempt to seize or take away the travel documents of Travellers unless such an act is made on proper grounds and lasts for a reasonable time; and</li> <li>Shall not do or say anything that will malign the reputation of City Explorers Private Limited and its flagship brands, City of operation and the country – India.</li></ol>','<h4>Non-Discrimination</h4><p>The Operator shall not (1) decline hosting any Traveller based on their ethnicity or race and/or (2) treat any Traveller different than the other based on their ethnicity or race. The host shall not make any detrimental statements towards any race, caste, nationality, gender or on any other grounds whatsoever. </p><h4>Sexual Harassment</h4><p>The Company is intolerant on sexual harassment. The Operator shall not sexually harass any Traveller in any way or form. The Operator shall ensure that while on the tour, all Travellers are not subject to any sexual harassment from (1) any other Traveller, (2) any member of the public or (3) any other Operator or shopkeeper. In the event that the Operator finds that any Traveller is being subject to sexual harassment, the Operator shall promptly intimate the Company about the same on the following:</p> <ol class=\"lower-alpha\"> <li>Via email on help@cityexplorers.in;</li> <li>Via call on (+91) 729 197 2715; and/or</li><li>Via whatsapp (+91) 729 197 2715.</li></ol>','<h4>Handling confidential information</h4><ul class=\"lower-alpha\"> <li>The Operator shall at all times abide by the Company’s privacy policy and shall not disclose the personal data of Travellers.</li> <li>The Operator shall not disclose any information provided to it by the Company without prior written authorisation from the Company for the same.</li> <li>The Operator shall at all times ensure the security and prevent any abuse or misuse of the information provided to it by the Company.</li> <li>The Operator shall refrain from asking Travellers about personal questions or questions about details of their booking with the Company.</li></ul><h4>Safety of Guests</h4><ul class=\"lower-alpha\"> <li>The Operator shall always attach top priority to the safety of the Travellers and remind them to be aware of their personal safety.</li> <li>The Operator shall at all times during the Activity (including any disturbance from any third party), be liable and responsible for the safety of the Travellers.</li> <li>In case of any accidents or a Traveller feeling unwell, the Operator shall help arrange immediate treatment for the Traveller and seek assistance from the Company without delay. They shall report the case to the police if necessary.</ul><h4>Picture policy</h4><p>The Operator shall ensure that neither he/she/it shall click pictures of any Traveller nor upload or showcase on any platform in any form unless otherwise Company consents thereto.</p><h4>Social media policy</h4><p>The Operator shall not upload any pictures of the Traveller without express consent of the Company. Further, the Operator shall not share any information about the Traveller on any social media platform</p>','<h4>Appearance</h4><p>The Operator shall dress properly as per the defined standards informed by the Company in order to enhance their professional image. When performing their duties as under this Agreement, they shall wear the T-shirt, cap, bag along with any other merchandise as provided by the Company.</p><h4>Branding Merchandise</h4><p>In the event the Operator is already an existing employee of another company/ entity as contained in this clause, the Operator hereby agrees and undertakes that he/she shall not in any way promote any other brand except for the brand of the Company by way of merchandise or in any other way or form unless the same has been so authorised by the Company.</p><h4>Identity card policy</h4><p>The Operator/s shall carry ID Card/s provided by the Company at all times while conducting any activity on behalf of the Company. It is further clarified that Company is not liable for any loss or misuse of the ID Card/s for carrying out any unlawful activities.</p>','<h4>Change in Itinerary</h4><p>In the event of any unforeseen circumstance, if the Operator changes any part of the itinerary as approved by the Company, the Operator shall intimate the Company of the same immediately, without any delay, via the following:</p><ol class=\"lower-alpha\"> <li>Via email on help@cityexplorers.in;</li> <li>Via call on (+91) 729 197 2715; and/or</li> <li>Via WhatsApp on (+91) 729 197 2715.</li></ol><h4>Guarantee of itinerary</h4><ol class=\"lower-alpha\"> <li>The Operator hereby agrees and undertakes that in the event that the Operator undertakes to provide any Activity (including exclusive access tours etc.) to the Travellers as part of the itinerary, it shall bear full responsibility for the same.</li> <li>In the event the Operator is unable to provide the specific Activity as contained in the approved itinerary, the Operator shall bear the liability for the same. Further, the Operator shall also indemnify the Company in the event the Company faces any losses or damages by virtue of the Operator not providing such an Activity to the Travellers.</li></ol>','<h4>Principles governing shopping activities</h4><ol> <li>The Operator shall ensure that the Travellers understand their consumer rights, which include the right to make or not to make purchases, the right to obtain information on products and services, the freedom to choose products and services, and the right to complain, request their purchases to be exchanged or refunded.</li> <li>The Operator shall only arrange visits to shops which have been designated by the Company in the itinerary provided by the Company to the Operator. However, the Operator may arrange a visit to any shop which is not included in the itinerary if it so requested by the Traveller. Further, in the event such an unlisted visit to a shop is undertaken, the Operator shall intimate the same to the Company promptly via call and/or whatsapp on the phone number (+91) 729 197 2715 (subject to change by the Company).</li> <li>The Operator shall not in any way compel or attempt to compel the Travellers to make any purchases or mislead or attempt to mislead them into doing so.</li> <li>The Operator shall allow the Travellers to freely leave or enter shops and shall not force them to remain inside the shops.</li> <li>If a Traveller is feeling unwell, the Operator shall immediately arrange for the Traveller in accordance with his/her/their wishes to leave the shops or take a rest at a place suitable to him/her/them. If required, the Operator shall arrange for the Traveller to see the nearest doctor or call an ambulance service as soon as possible.</li> <li>The Operator shall not allow their service attitude to be affected nor shall they refuse to perform their duties in the event of any Traveller’s unwillingness to purchase any items.</li></ol>','<h4>IP Ownership</h4><ol class=\"lower-alpha\"><li>It is hereby clarified that the Company is the proprietor and owner of all the intellectual property (“IP”). The IP of the Company shall not be used by the Operator in any other manner than as instructed by the Company.</li><li>It is further clarified that nothing in this Agreement shall be deemed to mean any transfer or assignment of the IP of the Company in favour of the Operator.</li></ol><small class=\"text-italic\">*I confirm that I have read all the above policies and I shall abide by them under all circumstances.</small>','<li>Please do not carry valuables.</li>\r\n          <li>Please wear a comfortable pair of walking shoes or flip-flops.</li>\r\n          <li>Carry enough water. Keep yourself hydrated.</li>\r\n          <li>Please wear conservative clothes. Revealing clothes may seem disrespectful and hurt people\'s sentiments.</li>\r\n          <li>Do not forget to carry cash on Food Walks to pay for the Food.</li>\r\n          <li>Carry a pair of sunglasses, a hat and sunscreen to protect yourself from the heat.</li>\r\n          <li>Carry a scarf to cover up your head. (For Visit to Spiritual Places)</li>\r\n          <li>Please wear weather appropriate clothing.</li>\r\n          <li>Keeping in mind the weather, carry an umbrella/ Raincoat.</li>\r\n          <li>Please do not carry bags or eatables inside the monument.</li>\r\n          <li>Cost of Entry Tickets wherever applicable has to paid by the participants directly.</li>','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras convallis consectetur convallis. Etiam imperdiet neque eget augue fermentum pulvinar. Phasellus nec aliquet risus, et elementum augue. Etiam in ultrices diam. Cras est ipsum, aliquet id diam ac, mollis ultricies velit. Fusce et consectetur urna. Pellentesque sit amet hendrerit dia