nge for the Traveller in accordance with his/her/their wishes to leave the shops or take a rest at a place suitable to him/her/them. If required, the Operator shall arrange for the Traveller to see the nearest doctor or call an ambulance service as soon as possible.</li> <li>The Operator shall not allow their service attitude to be affected nor shall they refuse to perform their duties in the event of any Traveller’s unwillingness to purchase any items.</li></ol>','<h4>IP Ownership</h4><ol class=\"lower-alpha\"><li>It is hereby clarified that the Company is the proprietor and owner of all the intellectual property (“IP”). The IP of the Company shall not be used by the Operator in any other manner than as instructed by the Company.</li><li>It is further clarified that nothing in this Agreement shall be deemed to mean any transfer or assignment of the IP of the Company in favour of the Operator.</li></ol><small class=\"text-italic\">*I confirm that I have read all the above policies and I shall abide by them under all circumstances.</small>','<li>Please do not carry valuables.</li>\r\n          <li>Please wear a comfortable pair of walking shoes or flip-flops.</li>\r\n          <li>Carry enough water. Keep yourself hydrated.</li>\r\n          <li>Please wear conservative clothes. Revealing clothes may seem disrespectful and hurt people\'s sentiments.</li>\r\n          <li>Do not forget to carry cash on Food Walks to pay for the Food.</li>\r\n          <li>Carry a pair of sunglasses, a hat and sunscreen to protect yourself from the heat.</li>\r\n          <li>Carry a scarf to cover up your head. (For Visit to Spiritual Places)</li>\r\n          <li>Please wear weather appropriate clothing.</li>\r\n          <li>Keeping in mind the weather, carry an umbrella/ Raincoat.</li>\r\n          <li>Please do not carry bags or eatables inside the monument.</li>\r\n          <li>Cost of Entry Tickets wherever applicable has to paid by the participants directly.</li>','Lorem ipsum