(83,20,3,43,19,'What happens if we reach late?','For the convenience of all attendees we ensure that our walking tours start on time. We highly recommend that you reach the starting location at least 10 minutes before the scheduled starting time for the tour. Please do ensure you reach on time.',NULL,'2020-01-27 01:47:35'),
