(198,25,1,59,1,'FAQs','Q. Who can join the walk?\r\nA. Any individual, group & family can join the walk.\r\n\r\nQ. In which language the tours are conducted?\r\nA. Preferably English but Hindi can be used as the requirement of the group.\r\n\r\nQ. What happens if we reach late?\r\nA.  For the convenience of all attendees we ensure that our walking tours start on time. We highly recommend that you reach the starting location at least 10 minutes before the scheduled starting time for the tour. Please do ensure you reach on time.\r\n\r\nQ. Do you allow Walk in Guests?\r\nA. No, walk in guests are not allowed. Everyone needs to book the walk prior and need a confirmation voucher\r\n\r\n',NULL,'2020-01-28 05:49:25'),
(199,25,1,59,1,'FAQs','Q. How will I recognize my Walk Leader?\r\nA. Contact number is provided. Please call the explorer once you reach the meeting point \r\n\r\nQ. What to wear?\r\nA. Please wear weather appropriate clothes and in some areas request you to dress conservatively.\r\n\r\nQ. Do I need to carry any beverage for the tour?\r\nA. Yes kindly carry plenty of water for the tour.\r\n\r\nQ. Any Guidelines?\r\nA. Kindly carry your personal medication, if any. Guests should take care of their own belongings such as mobile phones, wallets, and cameras. Kindly do not litter and scatter plastics and bottles on the roads. Carry Booking Voucher (confirmation email, code etc.) Carry Photo ID Proofs.\r\n',NULL,'2020-01-28 05:49:25'),
