(18,18,NULL,'Dr. Soumi Roy','Soumi_Roy.jpg','F','Indian','1989-09-10','Dr. Soumi Roy has had hands-on experience with the culturally-marginal society of the tribes of West Bengal. Escalating from there she went on to a stint of classroom teaching at Ashoka University. Her passion for the popularly perceived ‘dead-subject’ of History is to make it ‘come alive’. She brings the nuances of History in the simplest of language and makes the traveler travel back in time with her story-telling. Dr. Soumi Roy is an avid reader, researcher and story-teller. A pass out from Lady Shree Ram College. She holds an M.Phil. and PhD in History, from University of Delhi and Jawaharlal Nehru University, respectively. She has remained rooted to her culture and surroundings not just in her research but also in her ideals.','Vasant Kunj','Delhi','New Delhi ','10',135,110070,'','','','',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Research,Reading,Storytelling','Walk,Session,Experience,Meet-Up','New Delhi,Agra,Jaipur,Mumbai,Calacatta,Bangalore,Varanasi,Hyderabad City,Chennai City Central,Amritsar,Ahmedabad City,Poducherry_TN','Yes','City Maverick','English','English,Bengali,Hindi','1111 1111 1111','Aadhar-Card-Circular24.jpg','1111111111','A_sample_of_Permanent_Account_Number_(PAN)_Card25.jpg','11111111','minnesota-drivers-license16.jpg','','','111111111111111','3074e72d9d1608e5c6c933614824522819.jpg','3',0,'Video',1,1,1,1,NULL,0,1),
