(1,'1','Walk','Bhopal','Bhojpal to Bhopal',NULL,'Traces the evolution of the Bhopal city from the era of Raja Bhoj who created a dam (Pal, in local dialect), thus being named as BhojPal. Bhopal was ruled by four successive muslim begums, a unique distinction hard to find anywhere in world. ','Heritage Walk',NULL,NULL,NULL,NULL,'Hindi & English','Entry Tickets, Water Bottles, Walk Leader','Refreshments','The mix of orthodox Muslim architecture with the French influence of the Bourbons makes this a uniqu',NULL,NULL,NULL,NULL,'Sahishnu ','Mukherjee','8461810088','sahishnum@gmail.com','7291972715',NULL,NULL,'2018-09-09','2018-09-08',NULL,NULL,'Sheetal Das Ki Bagiya','07:30:00',NULL,'09:30:00','2 Hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,'Raja Bhoj International Airport','Bhopal Junction railway station','Bara Talab, Bhoja\'s Dam, Kamla Park, Kamla Pati Mahal, Hammam-e-kadami, Gauhar Mahal, Babe Sikandari Darwaza, Sadar Manzil, Moti Mahal, Moti Masjid.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100',NULL,NULL,NULL,NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_01.jpg','','','','Yes','Yes','Yes',NULL,'cover_01.jpg','1.jpg',1),
