(33,'33','Walk','Orchha','Exploring Orchha - The heart of Bundelkhand',NULL,'Orchha means a \"hidden place\" a city that is filled with History, culture, faith, friendship and love in every Street and corner.\nWhere ever you Turn, there is monument ready to narrate a story. Orchha is surrounded by forests, river and hills. It is a tiny town that can be covered by foot. Orchha was once the capital of Bundela Kings. Orchha was founded by the Bundela King Rudra Pratap (1501- 1531) while on hunt. He was enamored by this picturesque spot and decided to shift his from Gadkundar. The monuments here retain the historic touch to give to tourists an insight into its rich fast. If you are the lover of nature and history, you are sure to fall in love with Orchha. \n','Heritage',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.\n','Here are some of the attractions- Jahangir Mahal, Raj mahal, Ram Raja temple, Chaturbhuj Temple and ',NULL,NULL,NULL,NULL,'Nitin','Kumar Khare','9993385996, 9425342617','nitinguide.orchha@gmail.com','7291972715',NULL,NULL,'2018-09-09','2018-09-09',NULL,NULL,'Ticket counter, near the Fort Complex','08:00:00',NULL,'10:00:00','2 Hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Jahangir Mahal,Raj Mahal,Ram Raja temple,Chaturbhuj Temple',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100','','','',NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_33.jpg','','','','Yes','Yes','Yes',NULL,'cover_33.jpg','33.jpg',1),
(34,'34','Walk','Orchha','Adventure through the hidden Island\n(Cycle Tour)',NULL,'Orchha wildlife sanctuary lies within the area through which Betwa river ??ows. This is an island between two rivers Betwa and Jamini.\nit is one of the most scenic place in Madhya Pradesh, Orchha wildlife sanctuary is also the home for few of the most endangered species in the world. Orchha Wildlife Sanctuary is comparatively smaller, around 25 kms long and 15 kms wide. it covers an area of around 46 square kms. Yet the Orchha wildlife sanctuary gains importance due to few factors whichincludes:- rich wildlife, rivers, picturesque spots, old monuments, wildlife living within, and\nsome dense plantation.','Culture',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.\nRenting cost of bicycles.\n','Come walk with us and get to know the history and culture of Bundelkhand.',NULL,NULL,NULL,NULL,'Manohar Lal','Kewat','','','7291972715',NULL,NULL,'2018-09-16','2018-09-16','','','Another side by crossing the bridge of Betwa river','08:00:00',NULL,'10:00:00','2 Hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Chouraha,Panchmadi,View point,Charghat',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100','','','',NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_34.jpg','','','','Yes','Yes','Yes',NULL,'cover_34.jpg','placeholder.jpg',1),
