(38,'38','Walk','Gwalior','Educational Walk at Gujari Mahal',NULL,'Gujari Mahal is the main attraction of Gwalior Fort famous for its architecture, stories and a wonderful piece of beauty. This educational walk is especially designed for the students to build an interest of history and architecture in them. The walk also includes some interesting activities in between to keep the interest up in students and will get an opportunity to learn mobile photography basic skills. ','Heritage Walk',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.','History \nPhotography \nArchitecture\nActivities\n',NULL,NULL,NULL,NULL,'Saloni ','Sharma','8319830144','ss7157374@gmail.com','7291972715',NULL,NULL,'2018-10-07','2018-10-07','','','GUJARI MAHAL ARCHEOLOGICAL MUSEUM','10:00:00',NULL,'12:00:00','2 Hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gujari mahal fort',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100','','','',NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_38.jpg','','','','Yes','Yes','Yes',NULL,'cover_38.jpg','38.jpg',1),
(39,'39','Walk','Gwalior','Gwalior Food Walk - Taste on Tonga',NULL,'This food walk is an experience of Gwalior?s special delicacies including Gajak, Petha, Long Suji Gol Gappe, Karela, Faluda, famous Samosa and Imarti of Gwalior along with a variety of 7 architectural aspects at Maharaj Bada and Jain Temple made entirely with Gold on a Tonga. \nDid you know Maharaj Bada was once the capital of Central Provinces under British Raj?\n','Food Walk',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.','Local Food \nArchitecture \nReligious \n',NULL,NULL,NULL,NULL,'Saloni ','Sharma','8319830144','ss7157374@gmail.com','7291972715',NULL,NULL,'2018-09-09','2018-09-09','','','Daulat Ram Gupta Morena Gajak, Nai Sadak, Opp to Yadav Talkies','17:30:00',NULL,'19:30:00','2 Hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Daulat ram Gupta Morena gajak,Panchiraj Petha, Danaoli,Krishna Temple, Danaoli,Victoria Market,Tonga stop,Chaat Corners,Dilli Parathe Wale, Sarafa Bazar,Jain Swarn Mandir, sarafa Bazar,chotelal Kachori Wale, Patankar Bazar',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100','','','',NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_39.jpg','','','','Yes','Yes','Yes',NULL,'cover_39.jpg','39.jpg',1),
(40,'40','Walk','Gwalior','A time-machine walk to the Scindhian Age',NULL,'This walk through the masterpieces of heritage and historical importance is no less than timetravelling into the Scindhian Age. Experience the local tales of Rulers of earlier times and dipinto the art of present-day artisans. Capture the mighty heritage in your frames. Every detail in bits and pieces of the great history is an experience of stepping into the royal era.','Heritage Walk',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.','the tincture of art alongwith the heritage can prove to be the best experience. (street food can\nals',NULL,NULL,NULL,NULL,'Saumya','Gurjar','9171340372','singh.saumya80@gmail.com','7291972715',NULL,NULL,'2018-09-29','2018-09-29','','','Jai Villas Palace','08:00:00',NULL,'10:00:00','2 hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Jai Villas Palace & Museum,Amma Maharaj ki Chhatri,MLB Fine Arts college',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100','','','',NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_40.jpg','','','','Yes','Yes','Yes',NULL,'cover_40.jpg','40.jpg',1),
(41,'41','Walk','Gwalior','Symphony of Art & Culture',NULL,'The Chhatris are the memorial of Scindia dynasty rulers of Gwalior. Situated in Chhatri Bazar, the Chhatris of Scindia are one among  the prominent attractions in Gwalior city. Clubbed with the Rani Lakshmi  Bai Statue.\nThe walk will cover the area of chhatri where the memorials of scindia dynasty are built.The chattri are dedicated to Jivaji Rao Scindia,Daulat Rao Scindia and Janko Ji Rao Scindia among a lot of others. Known for its architectural Malevolence, the chattris are elevated, dome-shaped pavilions used as an element in Indian architecture. The first chattri was built in 1817 CE to commemorate Jayaji Rao Scindia. Since then other chhatris have been added.','Heritage Walk',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.','Indian Flag, MLB College & Katora Taal.',NULL,NULL,NULL,NULL,'Siddharth ','Sharma','8103388461','siddharth756@gmail.com','7291972715',NULL,NULL,'2018-09-16','2018-09-16','','','Jiwaji Club','10:30:00',NULL,'12:30:00','2 hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Chattri, Katora Taal, Jodhpur Misthan Bhandar & Rani Laxmibai Garden.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'100','','','',NULL,NULL,'Instant','Your Booking is Successful!\nPlease check your inbox for details.',NULL,NULL,'NA','','feature_41.jpg','','','','Yes','Yes','Yes',NULL,'cover_41.jpg','placeholder.jpg',1),
