(62,'62','Walk','Orchha','Exploring Orchha - The heart of Bundelkhand',NULL,'Orchha means a \"hidden place\" a city that is filled with History, culture faith. friendship and love in every Street and corner.\nWhere ever you Turn, there is monument ready to tell you story. Orchha is surrounded by forests, river and hills. it is a tiny town that can be covered by foot. Orchha was once the capital of Bundela Kings. Orchha was changed upon by the Bundela King Rudra Pratap (1501- 1531) while on hunt. He was enamored by this picturesque spot and decided to shift his capital to Orchha from gadkundar. the monuments here retain the historic touch to give to tourists an insight into its rich fast. if you are the lover of nature and history, you are sure to fall in love for orchha. \n','Heritage',NULL,NULL,NULL,NULL,'Hindi & English','Storytelling.','Refreshments.\nEntry Tickets.\n','Here are some of the attractions- Jahangir Mahal, Raj mahal, Ram Raja temple, Chaturbhuj Temple and ',NULL,NULL,NULL,NULL,'Nitin','Kumar Khare','9993385996, 9425342617','nitinguide.orchha@gmail.com','7291972715',NULL,NULL,'2018-10-07','2018-10-07',NULL,NULL,'Ticket counter, near the Fort Complex','08:00:00',NULL,'10:00:00','2 Hours','24 Hours',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Jahangir Mahal,Raj Mahal,Ram Raja temple,Chaturbhuj Temple',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0','','','','','','','','','','','','feature_62.jpg','','','','','','','','cover_62.jpg','placeholder.jpg',1),
